async function saveFile(byteBuffer: Buffer<ArrayBufferLike>, fileName: string) {
  await writeFile(`./src/gen/${fileName}`, byteBuffer)
}

export function getWorldData(base64WorldData: string): WorldData {
  const byteData = Buffer.from(base64WorldData, 'base64')
  const arrayBufferData = bufferToArrayBuffer(byteData)

  const protoMessageBytes = new ByteArray(new Uint8Array(arrayBufferData))
  protoMessageBytes.uncompress()

  // TODO maybe optimise this
  const allBytes: number[] = []
  while (protoMessageBytes.bytesAvailable > 0) {
    allBytes.push(protoMessageBytes.readByte())
  }

  const uint8Array = new Uint8Array(allBytes)

  return fromBinary(WorldDataSchema, uint8Array)
  // console.log('rawPacket: ', rawPacket);
}

export function bufferToArrayBuffer(buffer: Buffer<ArrayBufferLike>): ArrayBuffer {
  return new Uint8Array(buffer).buffer
}

function addBlocksEntry(blocks: ManyKeysMap<EelvlBlockEntry, vec2[]>, key: EelvlBlockEntry, x: number, y: number) {
  if (!blocks.has(key)) {
    blocks.set(key, [vec2(x, y)])
  } else {
    blocks.get(key)!.push(vec2(x, y))
  }
}

function getEscapadeBlockLookup(worldData: WorldData) {
  const lookup: Record<number, BlockEntry> = {}
  for (const block of worldData.blockEntries) {
    lookup[block.entryId] = block
  }
  return lookup
}

function getEscapadeBackgroundColor(worldData: WorldData, escapadeBlockLookup: Record<number, BlockEntry>): number {
  // TODO: This could be optimised by merging with main block read loop, but I cba
  const bgLayerByteArray = new ByteArray(worldData.layer[EelvlLayer.BACKGROUND])
  bgLayerByteArray.endian = 'LE'
  for (let x = 0; x < worldData.width; x++) {
    for (let y = 0; y < worldData.height; y++) {
      const entryId = bgLayerByteArray.readUnsignedInt()
      if (entryId === 0) {
        continue
      }

      const blockEntry = escapadeBlockLookup[entryId]
      if ((Number(blockEntry.blockId) as EscapadeBlockId) === EscapadeBlockId.HEX_BACKGROUND) {
        return blockEntry.intArgs[0]
      }
    }
  }
  return 0
}

export function getExportedToEelvlData(worldData: WorldData): [Buffer, string] {
  const escapadeBlockLookup = getEscapadeBlockLookup(worldData)

  const world: EelvlFileHeader = {
    ownerName: 'Unknown', // TODO
    name: 'Unknown', // TODO
    width: worldData.width,
    height: worldData.height,
    gravMultiplier: 1,
    backgroundColor: getEscapadeBackgroundColor(worldData, escapadeBlockLookup), // TODO
    description: 'Unknown', // TODO
    isCampaign: false,
    crewId: '',
    crewName: '',
    crewStatus: 0,
    minimapEnabled: true,
    ownerId: 'owner ID',
  }
  const bytes: ByteArray = new ByteArray(0)
  writeEeelvlFileHeader(bytes, world)

  const blocks = new ManyKeysMap<EelvlBlockEntry, vec2[]>()

  const layerByteArrays = [new ByteArray(worldData.layer[0]), new ByteArray(worldData.layer[1])]
  layerByteArrays[0].endian = 'LE'
  layerByteArrays[1].endian = 'LE'

  const TOTAL_LAYERS = 2

  // In Escapade and EE Offline layer 0 = Foreground, 1 = Background
  for (let layer = 0; layer < TOTAL_LAYERS; layer++) {
    for (let x = 0; x < world.width; x++) {
      for (let y = 0; y < world.height; y++) {
        const entryId = layerByteArrays[layer].readUnsignedInt()
        if (entryId === 0) {
          continue
        }

        const blockEntry = escapadeBlockLookup[entryId]

        const eelvlBlockId = Number(blockEntry.blockId)

        if ((eelvlBlockId as EelvlBlockId) === EelvlBlockId.EMPTY) {
          continue
        }

        // This block seems to be meant only to simulate EE bg color, but apparently you can place it in Foreground?
        // It appears as "CUSTOM" in Background Blocks tab
        if (
          (eelvlBlockId as EscapadeBlockId) === EscapadeBlockId.HEX_BACKGROUND &&
          (layer as EelvlLayer) === EelvlLayer.FOREGROUND
        ) {
          continue
        }

        if (!(eelvlBlockId in EelvlBlockId)) {
          if ((layer as EelvlLayer) === EelvlLayer.FOREGROUND) {
            placeUnknownBlockSign(bytes, eelvlBlockId, [vec2(x, y)])
          }
          continue
        }

        const blockEntryKey: EelvlBlockEntry = getBlockEntryKey(eelvlBlockId, blockEntry, layer)

        for (const key of blockEntryKey) {
          if (typeof key !== 'string' && typeof key !== 'number') {
            throw new Error(`Unexpected type in key. x: ${x}, y: ${y} Value: ${key}, type: ${typeof key}`)
          }
        }
        addBlocksEntry(blocks, blockEntryKey, x, y)
      }
    }
  }

  for (const [keys, positions] of blocks) {
    const eelvlBlockId: number = keys[0] as number
    const eelvlLayer: number = keys[1] as number
    bytes.writeInt(eelvlBlockId)
    bytes.writeInt(eelvlLayer)
    writePositionsByteArrays(bytes, positions)
    for (let i = 2; i < keys.length; i++) {
      const key = keys[i]
      if (typeof key === 'string') {
        bytes.writeUTF(key)
      } else if (typeof key === 'number') {
        bytes.writeInt(key)
      } else {
        throw new Error(`Unexpected type in key. Value: ${key}, type: ${typeof key}`)
      }
    }
  }
  bytes.compress()
  const fileName = `${world.name} - ${world.width}x${world.height}.eelvl`

  return [bytes.buffer, fileName]
}

function placeUnknownBlockSign(bytes: ByteArray, eerBlockId: number, positions: vec2[]): void {
  bytes.writeInt(EelvlBlockId.SIGN_NORMAL)
  bytes.writeInt(EelvlLayer.FOREGROUND)
  writePositionsByteArrays(bytes, positions)
  bytes.writeUTF(`Unknown EER block ID: ${eerBlockId}`)
  bytes.writeInt(1)
}

export function getBlockEntryKey(
  eelvlBlockId: number,
  blockEntry: BlockEntry,
  eelvlLayer: EelvlLayer,
): EelvlBlockEntry {
  return [eelvlBlockId, eelvlLayer, ...getBlockArgs(eelvlBlockId, blockEntry)]
}

function convertEscapadeLabelColorNumberToEelvlLabelColorString(escapadeLabelColorNumber: number): string {
  const invertedHexValue = 0xffffff - escapadeLabelColorNumber
  const invertedHexString = invertedHexValue.toString(16).padStart(6, '0')
  return '#' + invertedHexString
}

function getBlockArgs(eelvlBlockId: number, blockEntry: BlockEntry): EelvlBlockEntry {
  switch (eelvlBlockId as EelvlBlockId) {
    case EelvlBlockId.PORTAL_VISIBLE_LEFT:
    case EelvlBlockId.PORTAL_INVISIBLE_LEFT:
      return [blockEntry.intArgs[0], blockEntry.intArgs[1], blockEntry.intArgs[2]]
    case EelvlBlockId.SIGN_NORMAL:
      return [blockEntry.stringArgs[0], blockEntry.intArgs[0]]
    case EelvlBlockId.PORTAL_WORLD:
      return [blockEntry.stringArgs[0], blockEntry.intArgs[0]]
    case EelvlBlockId.LABEL:
      return [
        blockEntry.stringArgs[0],
        convertEscapadeLabelColorNumberToEelvlLabelColorString(blockEntry.intArgs[0]),
        100000, // Escapade has no wrap length parameter
      ]
    default:
      if (hasEelvlBlockOneIntParameter(eelvlBlockId)) {
        return [blockEntry.intArgs[0]]
      } else if (isEelvlNpc(eelvlBlockId)) {
        return [blockEntry.stringArgs[0], blockEntry.stringArgs[1], blockEntry.stringArgs[2], blockEntry.stringArgs[3]]
      } else {
        return []
      }
  }
}

function writePositionsByteArrays(bytes: ByteArray, positions: vec2[]) {
  const positionsX: ByteArray = new ByteArray(0)
  const positionsY: ByteArray = new ByteArray(0)

  for (const pos of positions) {
    positionsX.writeUnsignedShort(pos.x)
    positionsY.writeUnsignedShort(pos.y)
  }

  bytes.writeUnsignedInt(positionsX.length)
  bytes.writeBytes(positionsX)
  bytes.writeUnsignedInt(positionsY.length)
  bytes.writeBytes(positionsY)
}

